import './card.sass'


export const Card = () => {

    const [sismo, setSismo] = useState([]);

    useEffect(() => {
        Api();
    }, []);

    const Api = async() => {

        const url = 'https://api.gael.cl/general/public/sismos';
        const resp = await fetch( url );
        const data  = await resp.json();


        const respData = data.map( consulta => {
            return {
                Fecha: consulta.Fecha,
                Latitud: consulta.Latitud,
                Longitud: consulta.Longitud,
                Profundidad: consulta.Profundidad,
                Magnitud: consulta.Magnitud,
                Agencia: consulta.Agencia,
                RefGeografia: consulta.RefGeografia,
                FechaUpdate: consulta.FechaUpdate
            }
        })
        console.log(data)

    }




    return (
        <>

           {

               sismo.map( ({ Fecha, Latitud, Longitud, Profundidad, Magnitud, Agencia, RefGeografia, FechaUpdate }) => {
                   return(

                       <div className="container">
                           <div className="wrap-container">
                            <div className="card" >
                                <ul>
                                    <li>
                                        <img src="https://media.giphy.com/media/3o7bubiK9vDtxXCOgU/giphy.gif" alt=""/>
                                    </li>
                                </ul>
                            </div>
                           </div>
                       </div>

                   )

                })
           }
        </>
    )
}
